    backgroundColor: 'white',
    padding: 10,
    borderRadius: 5,
    paddingTop:10,
    marginVertical:50,
  },
  buttonText: {
    color: '#black',
    fontSize: 16,
    fontWeight: 'bold',
    fontFamily:'serif',
  },

});

export default ProfileScreen;
